import { applyMiddleware } from "redux";
import { composeWithDevTools } from "redux-devtools-extension";
import thunk from "redux-thunk";
import { reducer } from "./reducer";

export const store = () => {
	reducer, composeWithDevTools(applyMiddleware(thunk));
};
